import React, { useState } from "react";

const Index = () => {
  const [list, setList] = useState([]);
  const [count, setCount] = useState(0);
  const [message, setMessage] = useState({
    text: "",
  });
  return (
    <>
      <form>
        <input
          type="text"
          value={message.text}
          onChange={(e) => {
            setMessage({
              ...message,
              text: e.target.value,
            });
            setCount(count + 1);
          }}
        />
        <button
          onClick={(e) => {
            e.preventDefault();
            setList(message, count);
          }}
        >
          submit
        </button>
        <h1>{list.text}</h1>
        <h1>{list.count}</h1>
      </form>
    </>
  );
};
export default Index;
